package org.bots;

import org.bots.sources.FilmixSource;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.CommandLineRunner;
import org.springframework.boot.SpringApplication;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.telegram.telegrambots.ApiContextInitializer;
import org.telegram.telegrambots.TelegramBotsApi;
import org.telegram.telegrambots.exceptions.TelegramApiRequestException;
import org.telegram.telegrambots.generics.LongPollingBot;

import java.util.Base64;
import java.util.List;
import java.util.logging.Logger;

@SpringBootApplication
public class AppMain implements CommandLineRunner {

    private static Logger log = Logger.getLogger(AppMain.class.getSimpleName());

    @Autowired
    TelegramBotsApi telegramBotsApi;

    @Autowired
    List<LongPollingBot> bots;

    @Autowired
    FilmixSource filmixSource;

    public static void main(String[] args) {
        ApiContextInitializer.init();
        SpringApplication.run(AppMain.class, args);
//        String res = decoder("");
//        System.out.println(res);
    }

    private static String decoder(String data)
    {
        String[] a = new String[] {"0", "1", "2", "3", "4", "5", "6", "7", "=", "B", "D", "H", "I", "J", "L", "M", "N", "U", "V", "Z", "c", "f", "i", "k", "n", "p"};
        String[] b = new String[] {"d", "9", "b", "e", "R", "X", "8", "T", "r", "Y", "G", "W", "s", "u", "Q", "y", "a", "w", "o", "g", "z", "v", "m", "l", "x", "t"};

        for (int i=0; i < a.length; i++)
        {
            data = data.replace(b[i], "__");
            data = data.replace(a[i], b[i]);
            data = data.replace("__", a[i]);
        }

        return new String(Base64.getDecoder().decode(data));
    }

    @Override
    public void run(String... args) throws Exception {
        if(bots != null){
            bots.forEach(bot -> {
                try {
                    telegramBotsApi.registerBot(bot);
                } catch (TelegramApiRequestException e) {
                    e.printStackTrace();
                }
            });
        }

    }

}
